function [qdes] = trajectory_planar_robot_simulink(u_gen)
% Usage: [qdes] = trajectory_planar_robot_simulink(u_gen)
%        u_gen: [t]
% generated by planar_robot_2dof.m for planar_robot_simulation.slx

t = u_gen(1);
qdes = zeros(6,1);
qdes(1) = sin(pi*t)/10;
qdes(2) = cos(pi*t)/10;
qdes(3) = (pi*cos(pi*t))/10;
qdes(4) = -(pi*sin(pi*t))/10;
qdes(5) = -(pi^2*sin(pi*t))/10;
qdes(6) = -(pi^2*cos(pi*t))/10;
